- input: "TEXT\x1CC00009282\x1C1\x1C\x1CF3XA\x1C\"This report is being amended in
    response to the RFAI dated March 3, 2010 concerning the balances on the 2009 Year
    End report.  It was our intention to file amended November and December Monthly
    Reports prior to filing the Year End Report to ensure that the correct balances
    carried forward.  This amendment discloses a non-federal disbursement inadvertantly
    not reported on the 2009 November Monthly Report.  The incorrect balances noted
    in the RFAI will be corrected with this and the amended 2009 December Monthly
    Report also being submitted today.\"\n"
